%spark
// Make a sample of the data
{
sc.hadoopConfiguration.set("textinputformat.record.delimiter", "\n$$$$\n")
sc.hadoopConfiguration.set("dfs.block.size", "32M")
val rdd = sc.textFile("hdfs://spark-marco-master-000/surechembl")
    .sample(false, 0.5)
    .map(_+"\n$$$$")
    .saveAsTextFile("hdfs://spark-marco-master-000/surechembl_sample")
}
